class Solution(object):
    def specialPerm(self, nums):
        MOD = 10**9 + 7
        n = len(nums)
        nums.sort()
        dp = [[0] * (1 << n) for _ in range(n)]
        for i in range(n):
            dp[i][1 << i] = 1

        for mask in range(1, 1 << n):
            for i in range(n):
                if not mask & (1 << i):
                    continue
                for j in range(n):
                    if mask & (1 << j) or nums[i] % nums[j] != 0 and nums[j] % nums[i] != 0:
                        continue
                    dp[j][mask | (1 << j)] = (dp[j][mask | (1 << j)] + dp[i][mask]) % MOD

        return sum(dp[i][-1] for i in range(n)) % MOD
